//i totally improved this one
//variables that aren't present return null
//a variable with no value returns the true
function getUrlVars(urlz){
	//thanks for the function citizenray
	var vars=[];
	var hash="";
	var hashes=urlz.slice(urlz.indexOf('?')+1).split('&');
	for(var i=0;i<hashes.length;i++){
		hash=hashes[i].split('=');
		if(hash[1]!=null&&hash[1].indexOf("#")>=0)hash[1]=hash[1].substring(0,hash[1].indexOf("#"));
		if(hash[1]==undefined){
			hash[1]=true;
			if(hash[0].indexOf("#")>=0)hash[0]=hash[0].substring(0,hash[0].indexOf("#"));
		}
		vars.push(hash[0]);
		vars[hash[0]]=hash[1];
	}
	return vars;
}

function loadSounds(){
	var sounds=document.createElement("div");
  sounds.id="navi_sounds";
  sounds.style.display="none";
  document.body.appendChild(sounds);

  var come=document.createElement("audio");
  come.id="navi_toggleOn";
  come.controls=false;
	come.src=Come;
  sounds.appendChild(come);

  var go=document.createElement("audio");
  go.id="navi_toggleOff";
  go.controls=false;
	go.src=Go;
  sounds.appendChild(go);
	
	var post=[];
	for(var i=0;i<Post.length;i++){
		post[i]=document.createElement("audio");
		post[i].id="navi_post"+i;
		post[i].controls=false;
		post[i].src=Post[i];
		sounds.appendChild(post[i]);
	}

	//if it starts on, we need to do that
	if(toggled)
		document.addEventListener("DOMNodeRemoved",playSound,false);
	document.removeEventListener("load",loadSounds,true);
}

function playSound(e){
	if(e.target.id=="topic_viewers_update"){
		var	rand=Math.random();
		var inc=1/Post.length;
		for(var i=0;i<Post.length;i++){
			if(rand<(i+1)*inc){
				document.getElementById("navi_post"+i).play();
				break;
			}
		}
	}
}

function naviToggle(e){
	var data=JSON.parse(GM_getValue(Grey?"blacklist":"whitelist","[]"));
	for(var i=0;i<data.length;i++){
		if(data[i]==getUrlVars(location.href)["topic"]){
			data.splice(i,1);
		}
	}
	if(toggle.getAttribute("toggled")=="false"){
		document.addEventListener("DOMNodeRemoved",playSound,false);
		toggle.setAttribute("toggled","true");
		toggle.innerHTML="Navi is ON";
		if(e)
			document.getElementById("navi_toggleOn").play();
		if(!Grey)
			data.push(getUrlVars(location.href)["topic"]);
	}
	else if(toggle.getAttribute("toggled")=="true"){
		document.removeEventListener("DOMNodeRemoved",playSound,false);
		toggle.setAttribute("toggled","false");
		toggle.innerHTML="Navi is OFF";
		if(e)
			document.getElementById("navi_toggleOff").play();
		if(Grey)
			data.push(getUrlVars(location.href)["topic"]);
	}
	GM_setValue(Grey?"blacklist":"whitelist",JSON.stringify(data));
}

var datas=JSON.parse(GM_getValue(Grey?"blacklist":"whitelist","[]"));
var toggled=Grey;
for(var i=0;i<datas.length;i++){
	if(datas[i]==getUrlVars(location.href)["topic"]){
		toggled=!Grey;
		break;
	}
}

var toggle=document.createElement("span");
toggle.id="navi_toggle";
toggle.innerHTML="Navi is "+(toggled?"ON":"OFF");
toggle.setAttribute("toggled",(toggled?"true":"false"));
document.getElementsByClassName("quickpost")[0].parentNode.insertBefore(toggle,document.getElementsByClassName("quickpost")[0]);
toggle.addEventListener("click",naviToggle,false);
document.addEventListener("load",loadSounds,true);

GM_addStyle("#navi_toggle{font-weight:bold;cursor:pointer;margin-left:10px;text-decoration:underline;}");